   int stat = ASN_OK;
   ASN1BOOL optbit;

   rtdiag ("asn1PD_MagicActionChangeHumanFactors: start\n");

   /* optional bits */

   memset (&pvalue->m, 0, sizeof(pvalue->m));

   PU_NEWFIELD (ctxt_p, "fatiguePresent");

   stat = pd_bit (ctxt_p, &optbit);
   if (stat != ASN_OK) return LOG_ASN1ERR (ctxt_p, stat);
